window.bookSummaryJSON = "<p>A runaway bride. Her handsome getaway driver. A cozy town with a cast of animated citizens to help her figure it all out in this romantic comdedy.</p> <p>Noelle’s getting married three days before Christmas. It’s a dream come true—for her mom. For Noelle, it’s starting to feel like the walls are closing in. She’s known for months that something’s changing—namely, her fiancé. He’s becoming someone she doesn’t know anymore. She’s tried to ignore it, but her gut’s telling her that she’s marrying the wrong person.</p> <p>Nash retired from the military three months ago. He’s not in the mood to celebrate anything. He just wants to be left alone. His high school buddy’s getting married in a few days. He has no desire to go, but every time he tries to throw the invitation out, an alarm goes off in his head. For some reason, he feels like he’s supposed to be there.<br> <br> It’s 30 minutes before the wedding starts. Noelle’s in her wedding dress. Nash is in his seat. The universe is trying to bring these two strangers together. Is it ever too late to meet the man of your dreams?</p>"; 
